INSERT INTO `gossip_texts` (`entry`, `content_default`, `content_loc1`, `content_loc2`, `content_loc3`, `content_loc4`, `content_loc5`, `content_loc6`, `content_loc7`, `content_loc8`, `comment`) VALUES (-3134382, 'Give me the beacon, Slidore! Also, you still stink!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Slidore GOSSIP_ITEM_SLIDORE_BEACON');
INSERT INTO `gossip_texts` (`entry`, `content_default`, `content_loc1`, `content_loc2`, `content_loc3`, `content_loc4`, `content_loc5`, `content_loc6`, `content_loc7`, `content_loc8`, `comment`) VALUES (-3134383, 'I want a surgical strike, Slidore. Carpet the road with fire!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Slidore GOSSIP_ITEM_SLIDORE_FLIGHT');
INSERT INTO `gossip_texts` (`entry`, `content_default`, `content_loc1`, `content_loc2`, `content_loc3`, `content_loc4`, `content_loc5`, `content_loc6`, `content_loc7`, `content_loc8`, `comment`) VALUES (-3134391, 'I got you covered, Vipore. Move out!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'vipore GOSSIP_ITEM_VIPORE_ESCORT');
INSERT INTO `gossip_texts` (`entry`, `content_default`, `content_loc1`, `content_loc2`, `content_loc3`, `content_loc4`, `content_loc5`, `content_loc6`, `content_loc7`, `content_loc8`, `comment`) VALUES (-3134392, 'I am ready to rock, Vipore! Give me a beacon.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'vipore GOSSIP_ITEM_VIPORE_BEACON');
INSERT INTO `gossip_texts` (`entry`, `content_default`, `content_loc1`, `content_loc2`, `content_loc3`, `content_loc4`, `content_loc5`, `content_loc6`, `content_loc7`, `content_loc8`, `comment`) VALUES (-3134393, 'Tactical suppression fire, Vipore. Lay it on thick.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'vipore GOSSIP_ITEM_VIPORE_FLIGHT');
INSERT INTO `script_texts` (`entry`, `content_default`, `content_loc1`, `content_loc2`, `content_loc3`, `content_loc4`, `content_loc5`, `content_loc6`, `content_loc7`, `content_loc8`, `sound`, `type`, `language`, `emote`, `comment`) VALUES (-1134393, 'Senior Wing Commander Vipore launching. Pray for a swift death, Frostwolf.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 5, 'npc_wing_commander_vipore SAY_VIPORE_START_PATROL');
INSERT INTO `script_texts` (`entry`, `content_default`, `content_loc1`, `content_loc2`, `content_loc3`, `content_loc4`, `content_loc5`, `content_loc6`, `content_loc7`, `content_loc8`, `sound`, `type`, `language`, `emote`, `comment`) VALUES (-1134392, 'Their spirits are restored! The gryphons are ready to strike! Come, soldiers! Come to my side!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 5, 'npc_wing_commander_vipore SAY_VIPORE_FLIGHT_READY');
